1:40 PM Defendant Jonathan Scott Debauch appeared by video.  Attorney Brian David Van Ells appeared by video for Jonathan Scott Debauch.  Prosecuting attorney Anthony A. Lambrecht appeared by video for the State of Wisconsin. 
State moves to dismiss the enhancer in count 1. Motion granted. 
Count 1, Possession w/ Intent to Deliver Fentanyl, No contest plea entered. Rights explained. Convicted. The remaining counts are dismissed and read in. 
Sentence is withheld. Defendant is placed on probation to DOC for four (4) years. 
Conditions of probation:
1)	Spend twelve (12) months in the Manitowoc County Jail, under the Huber Law, imposed and stayed to be imposed at the agent's discretion and by further order of the court;
2)	Comply with all rules of the Manitowoc County Drug Court;
3)	AODA and follow through;
4)	Submit to random urine screens and pay for the same;
5)	Assessment, treatment, counseling as deemed appropriate by the Department's assessment process;
6)	Comply with work and school rules under the Drug Court rules;
7)	Provide DNA sample;
8)	Pay court costs;
9)	Pay supervision fees in an amount to be determined by DOC.
Minutes.
